INSERT INTO `forumdata` (`eforum_id`, `eforum_title`, `eforum_author`, `eforum_content`, `eforum_tags`, `eforum_time`) VALUES
(2, 'Top 10 food to eat in Kuantan', 'Sissie Lalia', 'Kuantan used to be a place I\'d visit at least twice a year because back in his audit days, rif was stationed there for a month or two. When I went over for the weekend, we\'d explore the area for good eats. Given our hectic schedules these days, I don\'t foresee us revisiting anytime soon. So I decided to do a Top 10 list to remember the good days.I will post it when I get 20 replies.', 'Leisure', '2018-05-21 07:40:14'),
(3, 'How much does a Software Engineer make in Malaysia?', 'Arnie Isaac', 'Is a monthly salary of RM 8,000 in Malaysia good for a C# developer having 5 years of experience?', 'Career', '2018-05-21 07:07:26'),
(4, 'SPOILERS ALERT!!! ', 'Anthony Stark', 'Who died in Avengers: Infinity War and what are their chances of coming back?\r\nAlready seen the latest Marvel film? If so, let\'s talk about the Avengers who died but might be coming back.', 'Entertainment', '2018-05-21 18:28:20'),
(5, 'WTF happened to Black Panther?', 'T\'Challa', 'The filming of Black Panther ended right around when Infinity War began shooting, meaning that Marvel had no idea just how popular Black Panther would become before its characters were written into Infinity War. This could explain T\'Challa\'s relatively unremarkable death-compared to that of, say, Spider-Man, who gets a tearful final moment with his mentor Tony Stark-and why the Black Panther had so few lines and little to do.', 'Entertainment', '2018-05-21 07:41:17'),
(6, 'Photoshop', 'Chi Ryo', 'What are the easiest ways to learn photoshop? How can I learn to layer in photoshop?', 'Education', '2018-05-21 07:19:35'),
(7, 'Networking Basics: What You Need To Know', 'Kassia Marlyn', 'A network connects computers, mobile phones, peripherals, and even IoT devices. Switches, routers, and wireless access points are the essential networking basics. Through them, devices connected to your network can communicate with one another and with other networks, like the Internet.', 'Education', '2018-05-21 07:21:11'),
(8, 'Lifelong Learning', 'T\'Challa', 'The 5th World Forum for lifelong Learning\r\nForum title: Lifelong Education and Learning for Sustainable Development: an Integrate Approach\r\nVenue: Madrid \r\nDate & Time: September 27, 28 & 29, 2017', 'Education', '2018-05-21 07:24:44'),
(9, 'Why programmers are single?', 'Chi Ryo', 'Many people are saying that for example guys who are learning about (working in) IT sector, programming for example, are single, or in other words without the other half(significant other). I hate stereotypes like these, so I wanted to ask, it is kinda private but, how many of you guys/girls are in a relationship? Maybe the question is stupid, but I wanted to ask this for some reason. I have a gf myself, and I know there are many older peeps here, but nvm :)) \r\n', 'Relationship', '2018-05-21 07:27:16'),
(10, 'Holiday in Kuantan', 'Chi Ryo', 'Hi!!!! I am bringing my friends to Kuantan. Is there any suggestion on things to do in Kuantan?', 'Leisure', '2018-05-21 07:30:12'),
(11, 'To leave or to stay in university during study week?', 'Kassia Marlyn', 'Do you agree that students have to stay in university during study week? Why?', 'Question', '2018-05-23 17:37:40');

